import { makeStyles } from '@mui/styles';


export const useStyles = makeStyles({
  customTextField: {
    '& .MuiOutlinedInput-root': {
        '& fieldset': {
            borderColor: 'white',
        },
        '&:hover fieldset': {
            borderColor: 'white',
        },
        '&.Mui-focused fieldset': {
            borderColor: 'white',
        },
        
    },
  },
});
